import React, {useState, useEffect} from 'react';
import './App.css';
import '@picocss/pico';


function App() {

  let [weaponImage, setWeaponImage] = useState(null);



  useEffect(() => {
    fetch("https://dog.ceo/api/breeds/list/all")
        .then(response => response.json())
        .then(data => console.log(data))
  }, [])



  return (
    <div>
      {weaponImage && <img src={weaponImage}></img>}
    </div>
  );
}

export default App;
